package com.example.rv_test;

import android.os.Bundle;

import androidx.activity.EdgeToEdge;
import androidx.appcompat.app.AppCompatActivity;
import androidx.core.graphics.Insets;
import androidx.core.view.ViewCompat;
import androidx.core.view.WindowInsetsCompat;
import androidx.recyclerview.widget.RecyclerView;

import java.util.ArrayList;

public class MainActivity extends AppCompatActivity {

    private ArrayList<Cars> cars = new ArrayList<>();

    private CarAdapter adapter;
    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        EdgeToEdge.enable(this);
        setContentView(R.layout.activity_main);
        ViewCompat.setOnApplyWindowInsetsListener(findViewById(R.id.main), (v, insets) -> {
            Insets systemBars = insets.getInsets(WindowInsetsCompat.Type.systemBars());
            v.setPadding(systemBars.left, systemBars.top, systemBars.right, systemBars.bottom);
            return insets;
        });


        adapter = new CarAdapter(cars);
        RecyclerView recyclerView = findViewById(R.id.rv_main);
        recyclerView.setAdapter(adapter);
        loadData();

    }
    private void loadData(){
        cars.add(new Cars("Ford", "data:image/jpeg;base64,", "FORD"));
        cars.add(new Cars("Toyota", "data:image/jpeg;base64,", "Toyota"));
        cars.add(new Cars("Nissan", "data:image/jpeg;base64,", "Nissan"));
        cars.add(new Cars("Ferrari", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTiyUSEv-bE-0jp5vyWl1a9qgFxHlr8i-zB7g&s", "Ferrari"));
        cars.add(new Cars("Mercedes", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRrRdCFwlW9FJqAPWvtO4sHvRvNyOF-ehszJA&s", "Mercedes"));
        cars.add(new Cars("BMW", "data:image/jpeg;base64,", "BMW"));
    }
}